import React from 'react';
import './Add.css'

function Add() {
    return (
        <div className='container'>
            <div className="content-wrapper">
                <a className="video-link" href="https://www.youtube.com/watch?v=ixTXlDhpHMc" target="_blank" rel="noopener noreferrer">
                    Click here to watch the video
                </a>
                <img className='main-add' src="https://scontent.fcai20-2.fna.fbcdn.net/v/t39.30808-6/369795403_685285470308741_6224046853657242457_n.jpg?stp=dst-jpg_s960x960&_nc_cat=107&ccb=1-7&_nc_sid=e3f864&_nc_eui2=AeHE6K0YriIsMvpuVNjHcgncvLMfMo46RYW8sx8yjjpFhbW6Ix5Am7SB4CQwhqh5CSoQFI2FpV61lPUc8qzftzVr&_nc_ohc=He4PfcV3s_0AX-XidJu&_nc_ht=scontent.fcai20-2.fna&oh=00_AfAyoZW-_QIcZ2GeKdObOYK2pToVLu91XnQSASKtk7vDrQ&oe=64EF0F4F" alt='' />
            </div>
        </div>
    );
}

export default Add;
